DROP TABLE IF EXISTS activity_rank;

CREATE TABLE activity_rank (
    cor_code BIGINT(20),
    cor_name TEXT,
    cor_type TEXT,
    net_working_capital_turnover TEXT,
    total_debt_turnover TEXT,
    total_asset_turnover TEXT,
    total_equity_turnover TEXT,
    equity_turnover TEXT,
    non_equity_turnover TEXT,
    score DOUBLE,
    tier TEXT,
    industry_id INT(11)
);

